INSERT INTO `announce` VALUES ('5', '实验注意事项', '<p class=\"MsoNormal\">\n	<span style=\"font-size:14px;\">1、用火狐浏览器Mozilla Firefox访问实验中心主页172.22.4.2</span>\n</p>\n<p class=\"MsoNormal\">\n	<span style=\"font-size:14px;\">2、点击右上角“登录”，学号+密码（初始123），如果不能登录，请注册，并找任课老师审核通过。</span>\n</p>\n<p class=\"MsoNormal\">\n	<span style=\"font-size:14px;\">3、从上机任务→所有任务找到对应课程并添加</span>\n</p>\n<p class=\"MsoNormal\">\n	<span style=\"font-size:14px;\">4、从我的任务查看对应课程，下载实验指导书，下课时上传作业。</span>\n</p>\n<p class=\"MsoNormal\">\n	<span style=\"font-size:14px;\">5、其它详细功能可以点击右上角的 “使用手册”</span>\n</p>\n<p class=\"MsoNormal\">\n	<span style=\"font-size:14px;\">6、上下课请打卡。</span>\n</p>', '超级管理员', '2014-10-06', null, null);
